// src/components/HouseList.js
import React, { useState, useEffect } from 'react';
import HouseCard from './HouseCard';
import './Houselisting.css';  // CSS to style the layout

function HouseList() {
  const [houses, setHouses] = useState([]);  // Placeholder for houses, will be populated via API later

  // Fetch house data via API (to be implemented later)
  useEffect(() => {
    // API logic will go here later to fetch houses
    // For now, we'll use static data
    const mockHouses = [
      {
        id: 1,
        type: "Apartment",
        price: "$250,000",
        description: "Beautiful apartment in downtown.",
        images: ["https://via.placeholder.com/300x200"]
      },
      {
        id: 2,
        type: "Villa",
        price: "$1,000,000",
        description: "Luxurious villa with private beach.",
        images: ["https://via.placeholder.com/300x200"]
      }
    ];
    setHouses(mockHouses);
  }, []);

  return (
    <div className="house-list">
      {houses.map((house) => (
        <HouseCard key={house.id} house={house} />
      ))}
    </div>
  );
}

export default HouseList;
